import React from 'react';

import classes from './Movie.module.css';

const ProductItems = (props) => {
  return (
    <li>
      <h2>{props.id}</h2>
      <h3>{props.title}</h3>
      <p>{props.description}</p>
          </li>
  );
};

export default ProductItems;
